import Register from './components/register/Register';


class App extends Component {
  render() {
    return (
      <Router>
            <Link path="/login">Login</Link>
            <Link path="/register">Register</Link>
            
            <Route key={i} path={route.path} component={route.component}/>
      </Router>
    );
  }
}


export default App;
